import './index.scss'
import { useNavigate } from 'react-router-dom'

export default function Cabecalho({ onLoginClick, showLogin }) {
    const navigate = useNavigate();

    function logOff() {
        localStorage.removeItem('TOKEN');
        navigate('/', { state: { showLogin: false } });
    }

    return (
        <header className='cabecalho'>
        <div className='cabecalho-conteudo'>
          {localStorage.getItem('TOKEN') ? (
            <div className='cabecalho-logado'>
              <div className="cabecalho-logo">
                <h1>DEV<p>HUB</p></h1>
              </div>
              <span className="cabecalho-botao">
                Retornar para &nbsp;
                <a href="#" onClick={logOff} className="logoff-button">
                  portada
                </a>
              </span>
            </div>
          ) : (
            <div className="cabecalho-nao-logado">
              <div className="cabecalho-logo">
                <h1>DEV<p>HUB</p></h1>
              </div>
              <button onClick={onLoginClick} className="cabecalho-botao">
                <b>Login</b>
              </button>
            </div>
          )}
        </div>
      </header>
      
    )
}
